import logo from './logo.svg'

const Header = () => {
    return (
        <div className="App-header">
            <div className="App-header-title" >
                <img src={logo} alt="Logo" />
                <h1>Restaurant Name</h1>
            </div>
            <div className="App-header-user-box">
                <button>Log In</button>
            </div>
        </div>
    )
}


export default Header;
